import React from "react";

import "./homepage.css";
import LOGO1 from '../../assets/LOGO1.png'

const HomePage = () => {
  return (
    <div className="section__padding" data-aos="fade-down">
      <div></div>

      <div className="homepage__logo">
        <img src={LOGO1} alt="logo"/>
      </div>
      {/* <h2>Sweat Smart!</h2> */}
    </div>
  );
};

export default HomePage;
